import { Component } from '@angular/core';

@Component({
  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.css']
})
export class NavbarComponent {
  constructor (private elementRef) {}

  input : boolean = false;

  handleInput = () => {
    this.input = !this.input;

    console.log(this.input);
  }

}
